export function closeError() {
    let error = document.getElementById('errors');
    error.style.backgroundColor = 'red';
    let errorText = document.getElementById('text-error');
    errorText.innerText = '';
    errorText.style.display = 'none';
    error.style.display = 'none';
    return;
};
